</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-d-un-effet-graphique-qml_affichage-d-une-fenetre-qml" href="#utilisation-d-un-effet-graphique-qml--graphicaleffects-">Affichage d'une fenêtre QML</a>
</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme principal:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
int main(int argc, char** argv) {
    QGuiApplication lApp(argc, argv);

    QQmlApplicationEngine lEngine;
    const QUrl lUrl(u"qrc:/qml/main.qml"_qs);
    QObject::connect(&amp;lEngine, &amp;QQmlApplicationEngine::objectCreationFailed,
        &amp;lApp, []() { QCoreApplication::exit(-1); },
        Qt::QueuedConnection);
    lEngine.load(lUrl);

    return lApp.exec();
}
//===============================================</pre><br>Affichage d'une fenêtre principale:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
Window {
    width: 400
    height: 300
    visible: true
    title: qsTr("ReadyApp")
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-d-un-effet-graphique-qml_tracage-d-un-rectangle" href="#utilisation-d-un-effet-graphique-qml--graphicaleffects-">Traçage d'un rectangle</a>
</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Traçage d'un rectangle:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
Window {
    width: 400
    height: 300
    visible: true
    title: qsTr("ReadyApp")

    Rectangle {
        x: 10; y: 10; width: 100; height: 100
        color: "red"
    }
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-d-un-effet-graphique-qml_remplissage-de-toute-la-fenetre" href="#utilisation-d-un-effet-graphique-qml--graphicaleffects-">Remplissage de toute la fenêtre</a>
</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Remplissage de toute la fenêtre:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
Window {
    width: 400
    height: 300
    visible: true
    title: qsTr("ReadyApp")

    Rectangle {
        anchors.fill: parent
        color: "red"
    }
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-d-un-effet-graphique-qml_ajout-d-un-effet-gradient" href="#utilisation-d-un-effet-graphique-qml--graphicaleffects-">Ajout d'un effet gradient</a>
</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Ajout d'un effet gradient:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
Window {
    width: 400
    height: 300
    visible: true
    title: qsTr("ReadyApp")

    Rectangle {
        anchors.fill: parent
        gradient: Gradient {
            GradientStop { position: 0.0; color: "green"; }
            GradientStop { position: 0.25; color: "purple"; }
            GradientStop { position: 0.75; color: "yellow"; }
            GradientStop { position: 1.0; color: "black"; }
        }
    }
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-d-un-effet-graphique-qml_ajout-d-un-texte-dans-un-rectangle" href="#utilisation-d-un-effet-graphique-qml--graphicaleffects-">Ajout d'un texte dans un rectangle</a>
